import React from 'react';
import HeroArea from '../../Components/Header/HeroArea.js';
import Banner from '../Banner/Banner.js';
import Services from '../Services/Services.js';

const Home = () => {
    return (
        <>
            <Banner></Banner>
            <Services></Services>
            <HeroArea></HeroArea>
        </>
    );
};

export default Home;
